<script><!--
var alb='',myb='\n',Dnb=' ',MCb=' GMT',Arb=' on ',Byb=' width="',grb='" target="_blank">',sob='">',mCb='$',Wob='%',clb='&',csb="'",Iqb="'.",jlb='(',vzb='([/\\\\\\.\\*\\+\\?\\|\\(\\)\\[\\]\\{\\}$^])',LCb='+',VBb=', Row size: ',qCb=', Size: ',Cnb='-',Kob='-ga:entrances',spb='-ga:pageviews',Dpb='-ga:searchRefinements',gqb='/',dlb='//www.google.com/jsapi?',rlb='/>',hqb='/comments/default',xzb='/feeds/features/',uzb='/feeds/maps/',Czb='/full',yyb='/media/',mwb='/positions',Cvb='/positions/NASDAQ:GOOG/transactions',_vb='/positions/NASDAQ:GOOG/transactions/1',cCb='0',$ub='123-456-7890',Xkb='127.0.0.1:8080',szb='1600 Amphitheatre Parkway\nMountain View, CA 94043',zlb='2.2',Gob='2009-07-01',Hob='2009-07-31',bxb='2038-01-19T03:14:07Z',cxb='5-Excellent',dxb='5752122',mlb=':',qlb='<',tob='<\/a>',yrb='<\/h2>',bzb='<\/h5><h5>GData API version: 2.2<\/h5>',Brb='<\/i>',GBb="<BUTTON type='button'><\/BUTTON>",tzb='<Placemark xmlns="http://www.opengis.net/kml/2.2"><name>Faulkner\'s Birthplace<\/name><description/><Point><coordinates>-89.520753,34.360902,0.0<\/coordinates><\/Point><\/Placemark>',hCb='<SELECT>',rob='<a href="',xrb='<h2>',azb='<h5> See source in ',zrb='<i>By ',Ayb='<img src="',Vyb="<img src='logo-small.png' alt='gwt logo' align='absmiddle'><span class='hm-title'>Google GData API Library for GWT Demo<\/span>",Bob='<p><i>Description not provided.<\/i><\/p>\n<p>(Add an implementation of <code>getDescriptionHTML()<\/code> for this demo)<\/p>',pwb='<p>As well as portfolio and transaction feeds, the Google Finance Portfolio Data API offers an intermediate, read-only feed know as the position feed. This is a summary of all of the contents of a particular portfolio, grouped by ticker symbol. Each entry in this feed, know as a position, is derived from the transactions entered for that symbol. Each position entry has position data that may include current number of shares of a particular stock or mutual fund if specified in the transactions as well as investment gain if requested and if purchase price and date have been specified.<\/p>',zwb="<p>In this sample, all transactions for a particular ticker (e.g. NYSE:IBM) are retrieved for a portfolio. The user's portfolio feed is queried and searched for a portfolio starting with 'GWT-Finance-Client'. The transaction feed for NASDAQ:GOOG is then queried for this portfolio and basic information is displayed. (This portfolio and transaction were created in the examples above -- if no transactions for a given ticker exist, the transaction feed will not exist and an error will be generated).<\/p>",lqb="<p>This sample adds a new comment to a blog post. The comment's contents contain the text 'GWT-Blogger-Client'.<\/p>",Fzb="<p>This sample code demonstrates how to create and insert a new map feature. It retrieves a list of the user's maps and inserts a feature with a title that starts with 'GWT-Maps-Client'.<\/p>",Pzb="<p>This sample code demonstrates how to delete an existing map of the authenticated user. It retrieves a list of the user's maps, and deletes the first map with a title that starts with 'GWT-Maps-Client'.<\/p>",Qyb="<p>This sample code demonstrates how to update an existing item of the authenticated user. It retrieves a list of the user's items, and updates the first item with a title that starts with 'GWT-GoogleBase-Client' with a new title and target country.<\/p>",ewb='<p>This sample code requests a specific portfolio entry as specified in the request URL.<\/p>',Eqb="<p>This sample creates a new blog post in the user's most recently updated blog. The post's title will be 'GWT-Blogger-Client: inserted post'.<\/p>",Nqb='<p>This sample deletes a comment from a blog post.<\/p>',Yqb="<p>This sample deletes the first blog post it finds that begins with the prefix 'GWT-Blogger-Client'.<\/p>",_pb='<p>This sample demonstrates how to access 50 of the account names, profile names, profile ids and table ids to which your login has access.<\/p>',zpb='<p>This sample demonstrates how to access the top ten pages ordered by number of pageviews to your website.<\/p>',_ob='<p>This sample demonstrates how to calculate the bounce rate for the top 10 sources of traffic to your website.<\/p>',Wtb='<p>This sample demonstrates how to create a new contact entry.<\/p>',dub='<p>This sample demonstrates how to create a new contact group.<\/p>',Gvb="<p>This sample demonstrates how to create a transaction.A new transaction is created in a user's Google Finance portfolio by posting a transaction entry to the appropriate Post URL. In this example, a transaction entry object is created and its properties (transaction type, etc.) are set, then the portfolio feed is queried for a list of the user's portfolios. The entry is inserted into the portfolio whose title starts with 'GWT-Finance-Client'.<\/p>",$rb='<p>This sample demonstrates how to create and insert a new calendar. The owncalendars feed is used to insert the new calendar entry for the authenticated user.<\/p>',rxb='<p>This sample demonstrates how to create and insert a new item. The items feed post URL (http://www.google.com/base/feeds/items) is used to insert a new item entry for the authenticated user.<\/p>',jzb='<p>This sample demonstrates how to create and insert a new map. The map feed post URL (http://maps.google.com/maps/feeds/maps/default/full) is used to insert a new map entry for the authenticated user.<\/p>',uvb='<p>This sample demonstrates how to create and insert a new portfolio. The portfolio feed post URL (http://finance.google.com/finance/feeds/default/portfolios) is used to insert a new portfolio entry for the authenticated user.<\/p>',Asb="<p>This sample demonstrates how to create and insert a recurring event into the authenticated user's primary calendar. The private/full feed is used for event insertion. The specifics of the recurrence such as recurring frequency and recurring duration are specified with a recurring string which is based on the iCalendar specification<\/p>",Hsb="<p>This sample demonstrates how to create and insert a single event into the authenticated user's primary calendar. The private/full feed is used for event insertion.<\/p>",isb="<p>This sample demonstrates how to create and insert a single event with a reminder to the authenticated user's primary calendar. The private/full feed is used for event insertion.<\/p>",ssb="<p>This sample demonstrates how to create and insert a single event with an extended property in the form of a name-value pair to the authenticated user's primary calendar. The private/full feed is used for event insertion.<\/p>",mub='<p>This sample demonstrates how to delete a contact entry. It queries for the most recently modified contact entry and deletes it.<\/p>',xub="<p>This sample demonstrates how to delete a contact group entry. It obtains the contact group that has a title that starts with 'GWT-Contacts-Client' and deletes the group.<\/p>",Osb="<p>This sample demonstrates how to delete an existing calendar of the authenticated user. It retrieves a list of the user's own calendars, and delete the first calendar with title that starts with 'GWT-Calendar-Client'. The owncalendars feed is used for calendar deletion.<\/p>",Zsb="<p>This sample demonstrates how to delete an existing event. A full text query is used to locate those events with the specified text, and the first match will be deleted from the authenticated user's primary calendar. The private/full feed is used for event deletion.<\/p>",Axb="<p>This sample demonstrates how to delete an existing item of the authenticated user. It retrieves a list of the user's items, and deletes the first item with a title that starts with 'GWT-GoogleBase-Client'.<\/p>",Wzb="<p>This sample demonstrates how to delete an existing map feature of the authenticated user. It retrieves a list of the user's maps and deletes the first map feature with a title that starts with 'GWT-Maps-Client'.<\/p>",Qvb="<p>This sample demonstrates how to delete an existing portfolio for the authenticated user. It retrieves a list of the user's portfolios, and deletes the first portfolio with a title that starts with 'GWT-Finance-Client'.<\/p>",Xvb="<p>This sample demonstrates how to delete an existing transaction within a portfolio of the authenticated user. It deletes the first GOOG transaction in the 'GWT-Finance-Client' portfolio, which was created in a preceeding example (an error will be generated if this does not exist).<\/p>",Spb='<p>This sample demonstrates how to get 30 days worth of Pageviews and Visits from Google Analytics.<\/p>',opb='<p>This sample demonstrates how to get the top browser languages in the United States.<\/p><div><strong>Note:<\/strong>if you have no visitors to your site from the United States, you will see no data.<\/div>',Mpb="<p>This sample demonstrates how to get the top internal site searches, their keyword refinements and the page the person was taken to when they clicked on the result.<\/p><div><strong>Note:<\/strong> To use this example you'll need to have Google Analytics configured to track internal site searches.<\/div>",Uwb='<p>This sample demonstrates how to load individual GData packages. In your GData apps you can enhance performance by loading only the GData packages that are used.<\/p>',etb='<p>This sample demonstrates how to perform a date query to retrieve events. The date query serves as a filter against all event entries of the private/full feed and return those events that have a start time between the specified minimum and maximum times. <\/p>',itb='<p>This sample demonstrates how to perform a full text query to retrieve events. The full text query serves as a filter against all event entries of the private/full feed and return those events that contain the specified text in the event title and/or description.<\/p>',Hub='<p>This sample demonstrates how to retrieve all members of a particular group. It first obtains the ID for a given contact group and uses it as the query parameter to retrieve all members of that group.<\/p>',ttb="<p>This sample demonstrates how to retrieve all primary calendar events for the authenticated user. The private/full feed is used to obtain the events from the private calendar with full projection. The sample iterates through the list of events and prints out each event's title.<\/p>",Qub='<p>This sample demonstrates how to retrieve contact entries for the authenticated user.<\/p>',Uub='<p>This sample demonstrates how to retrieve contact entries using query parameters.<\/p>',avb="<p>This sample demonstrates how to update a contact entry. It obtains the first contact entry with a title starting with 'GWT-Contacts-Client' and updates its title.<\/p>",ivb="<p>This sample demonstrates how to update a contact group entry. It obtains the first contact group entry that has a title that starts with 'GWT-Contacts-Client' and updates its title.<\/p>",Btb="<p>This sample demonstrates how to update an existing calendar of the authenticated user. It retrieves a list of the user's own calendars, and updates the first calendar with a title that starts with 'GWT-Calendar-Client'. The owncalendars feed is used to update an existing calendar.<\/p>",vAb="<p>This sample demonstrates how to update an existing map feature of the authenticated user. It retrieves a list of the user's maps and updates the first map feature with a title that starts with 'GWT-Maps-Client' with a new title.<\/p>",nAb="<p>This sample demonstrates how to update an existing map of the authenticated user. It retrieves a list of the user's maps, and updates the first map with a title that starts with 'GWT-Maps-Client' with a new title.<\/p>",Fwb="<p>This sample demonstrates how to update an existing portfolio for the authenticated user. It retrieves a list of the user's portfolios, and updates the first portfolio with a title that starts with 'GWT-Finance-Client' with a new title.<\/p>",Nwb="<p>This sample demonstrates how to update an existing transaction within a portfolio of the authenticated user. It retrieves and updates the first NASDAQ:GOOG transaction with the 'GWT-Finance-Client' portfolio (Note: The transaction must exist before it can be updated; otherwise an error is generated.)<\/p>",Jtb="<p>This sample demonstrates how to update the title of an existing event. A full text query is used to locate an event with a title/description containing 'GWT-Calendar-Client', where the first match is updated with the new title. The private/full feed is used for the event update.<\/p>",Cob='<p>This sample demonstrates how to use AuthSub to login, logout and retrieve the authentication status for the current user across the supported GData systems.<\/p>',OAb='<p>This sample displays Sidewiki entries created by the current user.<\/p>',irb='<p>This sample queries for blog posts that were published within the last month.<\/p>',Nub='<p>This sample retrieves all the contact groups for the authenticated user.<\/p>',nrb='<p>This sample retrieves the comments for a particular blog post.<\/p>',qrb="<p>This sample returns a list of blog posts for each of the user's blogs. Each post is a link to the actual post.<\/p>",Drb="<p>This sample returns a specific blog post by querying the entry's URI with getBlogPostFeed().<\/p>",Nrb="<p>This sample updates the first blog post it finds that begins with the prefix 'GWT-Blogger-Client'.<\/p>",Vxb='<p>This sample uses a snippets query to find an items corresponding to convertibles matching a set of criteria.<\/p>',Pxb='<p>This sample uses a snippets query to find items corresponding to digital cameras that match a set of criteria.<\/p>',Zxb='<p>This sample uses a snippets query to find items corresponding to housing that match a set of criteria.<\/p>',byb='<p>This sample uses a snippets query to find items corresponding to jobs that match a set of criteria.<\/p>',fyb='<p>This sample uses a snippets query to find items corresponding to recipes that match a set of criteria.<\/p>',FAb='<p>This sample uses an entry query to find Sidewiki content by a given author.<\/p>',KAb='<p>This sample uses an entry query to find Sidewiki content for a given site.<\/p>',urb='<p>This sample uses the "metafeed" feed to retrieve the authenticated user\'s list of blogs. Each blog is listed as a link to the actual blog.<\/p>',otb="<p>This sample uses the allcalendars feed to retrieve the authenticated user's list of calendars (primary, secondary and subscribed). The feed result is iterated through to print out each calendar's title.<\/p>",qyb='<p>This sample uses the attributes feed to query for metadata about products listed in Google Base. The attributes feed is useful for determining what kinds of attributes other users are using with certain item types. This example, looks at attributes related to the products vertical.<\/p>',cAb="<p>This sample uses the features feed to retrieve a list of features for the first map that has a title starting with 'GWT-Maps-Client'.<\/p>",iyb="<p>This sample uses the items feed to find an item with a title starting with 'GWT-GoogleBase-Client' and displays its attributes.<\/p>",vyb="<p>This sample uses the items feed to retrieve a list of all of an authenticated user's items. The title and URL of each item entry is printed.<\/p>",gAb="<p>This sample uses the maps feed to retrieve a list of all of the authenticated user's saved maps.<\/p>",iwb="<p>This sample uses the portfolio feed to retrieve a list of all of the authenticated user's portfolios. The title and ID of each portfolio entry is printed.<\/p>",Gyb="<p>This sample uses the private, read/write media feed to query an item's attached media. Each item has an associated media feed which can contain up to 10 binary attachments. Use this feed to manage binary attachments for your Google Base items. Google Base creates a set of thumbnails for each attachment, and stores the thumbnails on the Google Base server.<\/p>",Zkb='ABQIAAAAG8LzhtshQCjpSshU_uJjmxTBfUk9TZrBRaIteybtnU2KziHEpRQvhPNTjo7DMczjrRD3yBPRJ_BSQQ',Ykb='ABQIAAA
